muti_envs = len(bms)
envs = []
envs_n_states = []
prior_pass_all = {}
envs_n_actions = []

for bm in bms:
    key = f'{bm}'
    prior_pass_all[key] = []

for i in range(0, muti_envs):
    env_name = 'WASMEnv-v' + str(i)
    env_configs = {}
    pgm = bms[i]
    env_configs['pgm'] = pgm
    env_configs['device'] = "raspberry"

    register(
        id= env_name,
        entry_point = 'wasm_gym.envs:WASMEnv',
        kwargs={'env_config':env_configs},
        max_episode_steps=3000,
    )

    env = gymnasium.make(env_name)
    n_states = env.observation_space.shape[0]  
    n_actions = env.action_space.n  
    envs.append(env)
    envs_n_states.append(n_states)
    envs_n_actions.append(n_actions)

    # prior knowledge
    prior_pass = []
    indices=[]
    if env_configs['device'] == "all":
        exec_time_raw_rasp, _ = get_exec_time(env_configs['pgm'], indices, ".", "raspberry")
        exec_time_raw_jetson, _ = get_exec_time(env_configs['pgm'], indices, ".", "jetsonnano")
        exec_time_raw = exec_time_raw_rasp + exec_time_raw_jetson
    else:
        exec_time_raw, _ = get_exec_time(env_configs['pgm'], indices, ".", env_configs['device'])
    for i in range(n_actions):
        # if i<=76: continue
        indices=[]
        exec_time_raw, _ = get_exec_time(env_configs['pgm'], indices, ".", env_configs['device'])
        indices.append(i)
        passes=getPasses(indices) 
        passes_str =" ".join(str(x) for x in passes)
        print(passes_str)
        if env_configs['device'] == "all":
            exec_time_rasp, _ = get_exec_time(env_configs['pgm'], indices, ".", "raspberry")
            exec_time_jetson, _ = get_exec_time(env_configs['pgm'], indices, ".", "jetsonnano")
            exec_time = exec_time_rasp + exec_time_jetson
        else:
            exec_time, _ = get_exec_time(env_configs['pgm'], indices, ".", env_configs['device'])
        print("exec_time_raw:", exec_time_raw)
        print("exec_time:", exec_time)
        output_temp = ""
        output_temp += f"{passes_str}:{exec_time_raw};{exec_time};{exec_time_raw-exec_time}\n"
        prior_pass.append(exec_time_raw-exec_time)
        with open('prior.txt', 'a') as file:
            file.write(output_temp)
    print(prior_pass)
    prior_pass_all[env_configs['pgm']] = prior_pass
    output = ""
    output += f"{env_configs['pgm']}: {prior_pass}\n"
    with open('prior.txt', 'a') as file:
        file.write(output)
    

